    public struct CombinedControlsActions
    {
        private @TestingInputs m_Wrapper;
        public CombinedControlsActions(@TestingInputs wrapper) { m_Wrapper = wrapper; }
        public InputAction @Lift => m_Wrapper.m_CombinedControls_Lift;
        public InputAction @Thrust => m_Wrapper.m_CombinedControls_Thrust;
